import React, { useEffect } from 'react'
import { useDispatch } from 'react-redux'
import { getProfileById } from '../../store'

function profile( { match }) {
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(getProfileById())
    }, [])
  return (
    <div>profile</div>
  )
}

export default profile
